import React from 'react';
import Flags from 'country-flag-icons/react/3x2';

const Icono = (codigo, tipo, id) => {

  
    switch (codigo) {
      case "ES":
        return (
          <Flags.ES id={id} className="bandera" />
        );
      case "GB":
        return (
          <Flags.GB id={id} className="bandera" />
        );      
      case "FR":
        return (
          <Flags.FR id={id} className="bandera" />
        )
        case "DE":
        return (
          <Flags.DE id={id} className="bandera" />
        );
      case "SA":
        return (
          <Flags.SA id={id} className="bandera" />
        );      
      case "CN":
        return (
          <Flags.CN id={id} className="bandera" />
        )
        case "NL":
        return (
          <Flags.NL id={id} className="bandera" />
        );
      case "IN":
        return (
          <Flags.IN id={id} className="bandera" />
        );      
      case "IT":
        return (
          <Flags.IT id={id} className="bandera" />
        )
        case "PT":
        return (
          <Flags.PT id={id} className="bandera" />
        );
      case "RU":
        return (
          <Flags.RU id={id} className="bandera" />
        );      
      
    }

  }  

  export default Icono;
